import { useRouteError, Link } from "react-router-dom"

export default function CareersError() {
  const error = useRouteError()

  return (
    <div className="careers-error">
      <h2>Error</h2>
      <p>{error.message}</p>
      <Link to='/'>Go back to the home</Link>
    </div>
  )
}
